import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from '../assets/pages/Home/Home';
import Products from '../assets/pages/Products/ProductsEnhanced';
import Cart from '../assets/pages/Cart/Cart';
import ResponsiveCart from '../assets/pages/Cart/ResponsiveCart';
import Checkout from '../assets/pages/Cart/Checkout.jsx';
import Orders from '../assets/pages/Orders/Orders';
import OrderHistory from '../assets/pages/Orders/OrderHistory';
import OrderTracking from '../assets/pages/Orders/OrderTracking';
import PaymentGateway from '../assets/pages/Payment/PaymentGateway';
import Profile from '../assets/pages/Profile/Profile';
import HelpDesk from '../assets/pages/HelpDesk/HelpDesk';
import Login from '../assets/pages/Auth/Login';
import Signup from '../assets/pages/Auth/Signup';
import Dashboard from '../assets/pages/Admin/Dashboard';
import TestRazorpay from '../assets/pages/TestRazorpay';
import ProtectedRoute from '../assets/components/ProtectedRoute';

// Error boundary component for better error handling
const ErrorBoundary = ({ children, fallback }) => {
  try {
    return children;
  } catch (error) {
    console.error('Route component error:', error);
    return fallback || <div className="p-4 text-center text-red-600">Something went wrong. Please try again.</div>;
  }
};

const AppRoutes = ({ isAuthenticated }) => (
  <Routes>
    {/* Public Routes */}
    <Route path="/" element={
      <ErrorBoundary>
        <Home />
      </ErrorBoundary>
    } />
    <Route path="/products" element={
      <ErrorBoundary>
        <Products />
      </ErrorBoundary>
    } />
    <Route path="/login" element={
      <ErrorBoundary>
        <ProtectedRoute requireAuth={false}>
          <Login />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    <Route path="/signup" element={
      <ErrorBoundary>
        <ProtectedRoute requireAuth={false}>
          <Signup />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    
    {/* Test Route */}
    <Route path="/test-razorpay" element={
      <ErrorBoundary>
        <TestRazorpay />
      </ErrorBoundary>
    } />
    
    {/* Semi-Protected Routes - cart allows guest access */}
    <Route path="/cart" element={
      <ErrorBoundary>
        <ResponsiveCart />
      </ErrorBoundary>
    } />
    <Route path="/cart/old" element={
      <ErrorBoundary>
        <Cart />
      </ErrorBoundary>
    } />
    <Route path="/checkout" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <Checkout />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    
    {/* Protected Routes - require authentication */}
    <Route path="/orders" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <Orders />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    <Route path="/orders/history" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <OrderHistory />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    <Route path="/orders/:orderId" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <OrderTracking />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    <Route path="/orders/track/:orderId" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <OrderTracking />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    <Route path="/orders/track" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <OrderTracking />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    <Route path="/payment" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <PaymentGateway />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    <Route path="/profile" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <Profile />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    <Route path="/helpdesk" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <HelpDesk />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    
    {/* Admin Routes - require authentication */}
    <Route path="/admin/dashboard" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <Dashboard />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    <Route path="/admin/orders" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <Dashboard />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    <Route path="/admin/products" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <Dashboard />
        </ProtectedRoute>
      </ErrorBoundary>
    } />
    <Route path="/admin/users" element={
      <ErrorBoundary>
        <ProtectedRoute>
          <Dashboard />
        </ProtectedRoute>
      </ErrorBoundary>
    } />

    {/* 404 Fallback */}
    <Route path="*" element={
      <ErrorBoundary>
        <div className="min-h-screen bg-gray-50 flex items-center justify-center">
          <div className="text-center">
            <h1 className="text-4xl font-bold text-gray-900 mb-4">404</h1>
            <p className="text-gray-600 mb-8">Page not found</p>
            <a href="/" className="inline-flex items-center px-6 py-3 bg-orange-500 text-white font-semibold rounded-lg hover:bg-orange-600 transition-colors">
              Go Home
            </a>
          </div>
        </div>
      </ErrorBoundary>
    } />
  </Routes>
);

export default AppRoutes;
